webpackJsonp([0x80d86216b26d],{443:function(e,i){e.exports={data:{remark:{html:'<!-- **************************************** -->\n<header class=\'hero simple\'>\n<div class=\'container\'>\n<div class=\'row\'>\n<div class=\'col-xs-12\'>\n<div class=\'hero-block\'>\n<h1 id="support"><a href="#support" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Support</h1>\n<h3>\n  Professional and community support services\n</h3>\n</div>\n</div>\n</div>\n</div>\n</header>\n<!-- **************************************** -->\n<section>\n<div class=\'container\'>\n<div class=\'row\'>\n<div class=\'col-xs-12 col-md-6\'>\n<h2 id="community-support"><a href="#community-support" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Community Support</h2>\n<ul>\n<li>Request features.</li>\n<li>Advice from the community.</li>\n<li>Report issues.</li>\n<li>Discuss the future of the project.</li>\n</ul>\n<p><a href="https://github.com/graphile/postgraphile/issues">PostGraphile support</a></p>\n<p><a href="https://github.com/graphile/graphile-build/issues">Graphile Build support</a></p>\n<p><a href="https://gitter.im/graphile/postgraphile">Gitter chat</a></p>\n</div>\n<div class=\'col-xs-12 col-md-6\'>\n<h2 id="professional-services"><a href="#professional-services" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Professional Services</h2>\n<ul>\n<li>Tweak Graphile to fit your needs.</li>\n<li>Professional support.</li>\n<li>Security and performance vetting.</li>\n<li>Team and one-to-one training at <a href="https://graphql-training.com">GraphQL-Training</a>.</li>\n</ul>\n<p>Consultancy services (advice, code review, training, support, debugging) can be\npurchased in blocks of a few hours. Development will typically involve a\ndiscovery period followed by a quote for the work.</p>\n<p>Discounts are available at our discretion for contributors, sponsors, larger\nblocks or tasks, pre-revenue start ups, not-for-profits and people from\nunder-represented groups.</p>\n<p>See <a href="/support/#faqs">FAQs</a> below for more information</p>\n<p>Email us at <a href="mailto:info@graphile.org?subject=Graphile%20Custom%20Work%20or%20Support">info@graphile.org</a> for details.</p>\n</div>\n</div>\n</div>\n</section>\n<!-- **************************************** -->\n<section>\n<div class=\'container\'>\n<div class=\'f5 ttu fw6 mt0 mb3 bb pb2\'>\nFAQs\n</div>\n<div class=\'row\'>\n<div class=\'col-xs-12 col-md-6\'>\n<h3 id="which-repository-do-i-report-issues-to"><a href="#which-repository-do-i-report-issues-to" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Which repository do I report issues to?</h3>\n<p>If you know which file contains the issue, please report to the repository that\nfile belongs to. If you\'re not sure and you\'re using PostGraphile then please\nreport via the <a href="https://github.com/graphile/postgraphile/issues">PostGraphile issue\ntracker</a>, otherwise report\non the <a href="https://github.com/graphile/graphile-build/issues">Graphile Build issue\ntracker</a>. For security vulnerabilities please email <a href="mailto:benjie@graphile.org?subject=PostGraphile%20Security%20Vulnerability">benjie@graphile.org</a> with the details.</p>\n<p>You can visit <a href="">Reporting an issue</a> for more information on how to do this, along with a bug reporting template.</p>\n<h3 id="theres-a-typo-in"><a href="#theres-a-typo-in" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>There\'s a typo in...</h3>\n<p>We ❤️ <span> </span>typo fixes - and it\'s the easiest way for you to make your mark on the\nproject! If the typo is in this website; please open a PR to <a href="https://github.com/graphile/graphile.github.io">the graphile.github.io\nrepository</a>. If the typo is in\none of the tools, please raise a pull request with the relevant repository (see\nabove).</p>\n<p>Raising a pull request is super easy - you can edit a markdown file directly\nthrough the GitHub interface - simply find the file in question and press the\nEdit (pencil) button and follow the instructions. If you\'re not comfortable\nraising a pull request, feel free to raise the edit as an issue, but be aware\nthat it\'ll take longer to fix.</p>\n<h3 id="how-quickly-can-i-expect-a-response"><a href="#how-quickly-can-i-expect-a-response" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>How quickly can I expect a response?</h3>\n<p>Community support, offered via GitHub, can take anywhere from minutes to months\nfor a response. I\'m very grateful to the community for helping each other out,\nimproving the documentation and all the other work they help with.</p>\n<p>If you require help on a tighter deadline, or in greater depth, you should\nengage our professional services. I aim to respond to all messages by the end\nof the next working day (UK calendar); often it will be much sooner.</p>\n</div>\n<div class=\'col-xs-12 col-md-6\'>\n<h3 id="who-are-you"><a href="#who-are-you" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Who are you?</h3>\n<p>I\'m the primary maintainer of the Graphile suite of tools, <a href="https://github.com/benjie">Benjie\nGillam</a>. I\'ve been writing JavaScript for 20 years,\nPostgreSQL for 10 years and Node.js since early 2012. I\'ve been helping people\nwith their PostGraphile/PostGraphQL issues since 2016.</p>\n<h3 id="how-do-the-professional-services-work"><a href="#how-do-the-professional-services-work" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>How do the professional services work?</h3>\n<p>Email me with a brief outline of what you need and I\'ll get back to you either\nwith an estimate of the cost of the work, a request for a call to discuss the\nscope of the work, some alternative solutions you may not have considered, or\nI might decline the work (for example if it\'s out of the scope of Graphile or\nI do not have sufficient availability).</p>\n<h3 id="could-you-just-add-this-one-feature"><a href="#could-you-just-add-this-one-feature" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Could you just add this one feature...?</h3>\n<p>Sure. Get in touch at <a href="mailto:info@graphile.org?subject=Graphile%20Custom%20Work%20or%20Support">info@graphile.org</a> and we\'ll estimate the cost of implementing the feature!</p>\n</div>\n</div>\n</div>\n</section>\n<!-- **************************************** -->',frontmatter:{path:"/support/",title:"Support for PostGraphile and Graphile Build from the maintainer"}}},pathContext:{layout:"marketing"}}}});
//# sourceMappingURL=path---support-3d1d219a638e5f6326b3.js.map